window.bookSummaryJSON = "<p>Two Weddings.<br> One Divorce.<br> The Perfect Fake Date.<br> <br> Anna McKinley, the black sheep of her family, faces the embarrassment of attending her younger sister’s wedding alone after breaking off her engagement last year. But after a couple of glasses of wine with a handsome stranger, they concoct a plan for him to help her save face by attending the wedding as her date. Complete with a fake name and an irresistible first date story, she and “Isaac” embark on an innocent con that turns into a magical night.<br> <br> Fast forward twelve years, Anna still wound up the average statistic: married with two kids, living in the suburbs, and a husband asking her for a divorce. Even though the divorce is a long time coming, she and her husband decide to keep up appearances during her niece’s wedding, hiding their marriage’s doom from friends and family.<br> <br> As each wedding progresses, Anna realizes how easy it is to fall in love… especially when she’s faking it.</p>"; 
